<body>
    <script>
        function elimination(arr) {
            for (let i = 0; i < arr.length; i++) {
                for (let j = 0; j < arr.length; j++) {
                    if (i !== j && arr[i] === arr[j]) {
                        return arr[i];
                    }
                }
            }
            return null;
        }


        console.log(elimination([5, 6, 7, 8, 9, 1, 2, 3, 4, 5]))
    </script>
</body>
